import React from 'react';
import '../App.css'

const ResumePage = () => {
  return (
    <div className="resume-container">
      <h1>Резюме проекту</h1>
      <p><strong>Тема:</strong>  Розроблення програмного продукту для роботи з файловою базою даних про прихід товарів на склад підприємства</p>
      <p><strong>Виконав:</strong></p>
      <p>студент 3 курсу </p>
      <p>групи 6.04.122.010.21.2</p>
      <p>факультету ІТ</p>
      <p>Бак Р.С.</p>
    </div>
  );
};

export default ResumePage;
